import { Database, Code } from "lucide-react";
import SubjectPage from "./SubjectPage";

const DBMS = () => {
  const topics = [
    {
      name: "SQL Basics",
      desc: "Learn SELECT, INSERT, UPDATE, DELETE, and filtering data.",
      icon: <Database className="w-10 h-10 text-green-600" />,
      path: "/placement-prep/core-subjects/dbms/sql-basics",
      color: "from-green-100 to-green-50",
    },
    {
      name: "Normalization",
      desc: "Understand 1NF, 2NF, 3NF, and BCNF concepts with examples.",
      icon: <Code className="w-10 h-10 text-blue-600" />,
      path: "/placement-prep/core-subjects/dbms/normalization",
      color: "from-blue-100 to-blue-50",
    },
    // Add more topics here...
  ];

  return (
    <SubjectPage
      title="DBMS Preparation"
      description="Master database concepts, SQL queries, and transaction management."
      topics={topics}
    />
  );
};

export default DBMS;
